import Header from "../Components/header"
import TextField from '@material-ui/core/TextField';


const styles = theme => ({
    textField: {
        width: '90%',
        marginLeft: 'auto',
        marginRight: 'auto',            
        paddingBottom: 0,
        marginTop: 0,
        fontWeight: 500
    },
    input: {
        color: 'white'
    }
});

const Signup = function(){
    return <div>
        <Header></Header>
        <div class="SignupDiv">
            <h1>Sign Up</h1>
            <form>
            <TextField variant="standard" color="secondary" label="Full Name" size="medium" InputProps={{
        className: classes.input,
    }}></TextField>
            </form>
        </div>
    </div>
}

export default withRouter(Signup);
